import React from "react";
import "./Search.scss";
import Template from "../components/Template";
import { useQuery } from "@apollo/client";
import { gql } from "../__generated__";

const GET_CATS = gql(`
query GetCats($offset: Int, $limit: Int) {
  cats(offset: $offset, limit: $limit) {
    owner {
      name
    }
    name
  }
}
`);

function Search() {
  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
  };

  const { loading, error, data } = useQuery(GET_CATS);
  if (loading) return <Template>Loading...</Template>;
  if (error) return <Template>Error : {error.message}</Template>;

  const elements = data?.cats?.map((c) => (
    <li>
      {c.name} - {c.owner.name}
    </li>
  ));

  return (
    <Template>
      <form onSubmit={handleSubmit}>
        <label>
          Search:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
      <ul>{elements}</ul>
    </Template>
  );
}

export default Search;
